import { Component } from '@angular/core';
import { NgToastModule } from 'ng-angular-popup';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.sass'],
  imports: [NgToastModule]
})
export class AppComponent {
  title = 'todo-list';
}
